import Pokedex from "./Pokedex";

export default function PokemonCard({ name, id, img }) {
  return (
    <>
      <div className="grid grid-cols-4 gap-4 bg-purple-50">
        <div className="container">
          <h1>{name}</h1>
          <h3>{id}</h3>
          <img src={img} alt="pokemon" />
        </div>
      </div>
    </>
  );
}
